INSERT INTO `news` (`id`, `title`, `subtitle`, `article`, `image_link`, `external_link`) VALUES
(1, 'Test Article', 'This is the First Article', 'The 3rd Annual Sweet Sounds of Music Fundraiser benefitting Uptown Music Theatre will be held on Sunday, October 20, 2013 at the Xavier University Grand Ballroom. Proceeds from this event will fund this group of talented, local youth as they prepare to compete in the National Junior Theatrics Festival being held in Atlanta in January 2014. Uptown Music Theatre has been recognized as one of eight top theatrical organizations in the nation in their two previous trips to the competition. In addition to competing for a three-peat victory at the 2014 event, UMT has been selected to present a musical excerpt from Disney’s soon to be released 101 Dalmatians, Jr.  UMT performers will be featured on the main stage of the competition and perform for an audience of nearly 5000 attendees and musical theatre professionals from around the country. Generous donors like you are the key to our success. We hope that we can count on your support. To find out more about the programs of the Uptown Music Theatre or to donate online visit http://www.umtno.org/. To find out more about the Junior Theatrics Festival visit http://www.itheatrics.com/.', 'http://truthuniversal.com/images/TruthLogo.jpg', 'http://truthuniversal.com');
